  \"food-habits-of-black-ducks-wintering-in-west-central-tennessee\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study was conducted to describe the
  food habits of black ducks (Anas rubripes) wintering in west central Tennessee and
  to compare foods of black ducks and mallards (A. platyrhynchos) collected from sympatric
  habitats. Ducks were collected from Tennessee National Wildlife Refuge during winter
  1990-1991. Seeds predominated in the diet of black ducks and mallards; with spikerush,
  smartweed, rice cutgrass being the most common. Seasonal variation and differences
  in diets between black ducks and mallards were best explained by differences in
  habitat selection and food availability. Despite minor differences in habitat selection
  and food habits between black ducks and mallards at Tennessee NWR, food habits of
  the species were similar. No significant differences were detected between diets
  of males or females wintering at TNWR. Black ducks fed primarily upon low protein
  foods, perhaps indicating that energy requirements for maintenance and spring migration
  were more important than protein demands. Foods high in carbohydrates and fats were
  primary foods consumed by blacks ducks and mallards, and energy appears to be the
  primary dietary need of the black ducks wintering at TNWR\",\n\t\"license_title\":
